import React from 'react'
import TarjetasVista from './TarjetasVista';

const AreasVista = ({posts, changeParams}) => {
    changeParams({
        collection: "areas",
        filter: {}
    })
    return (
        <div className="AreasVista">
            <TarjetasVista tarjetas={posts} />
        </div>
    );
    // return (
    //     <div className="AreasVista">
    //         <TarjetasVista tarjetas={posts} />
    //     </div>
    // );
    
}

export default AreasVista
